import React, { Component } from 'react';

export default (props) => {
    return (
        <nav>
            <h2 class="logo">
                <a class="logo-link" href="#">{props.title}</a>
            </h2>
            <ul class="nav-menu">
                <li><a className="nav-menu-link" href="Home">Home</a></li>
                <li><a className="nav-menu-link" href="#">Portfolio</a> </li>
                <li><a className="nav-menu-link" href="#">Support</a></li>
            </ul>
        </nav>
    );
}
